import React from "react";

export default props => {
    const styles = {
        textAlign: "center"
    }

    return (
        <input 
        disabled
        style={styles}
        value={props.text} type="text" 
        class="form-control form-control-lg bg-white"/>
    )
}

<div class="input-group">
    <input 
    disabled
    style={styles}
    value={props.text} type="text" 
    class="form-control form-control-lg bg-white"/>
    <div class="input-group-append" id="button-addon4">
    
    </div>
</div>
